%[text] # Demo for Peroidic Boundary Conditions
%[text] 
%[text] Leb be given the rechtangular shaped domain $\\Omega \\subset \\mathbb R^2,\\Omega = (0,2)\\times(0,3)$. Let the  edges of the rectangle may the boundary segments $\\Gamma\_k$, $k=1,2,...4$. We solve the problem
%[text]  $-\\Delta u + u = f\\text{ on }\\Omega$
%[text] under the constraint, that $u$ fulfills a periodic boundary conditions 
%[text]  $u(x)|\_{\\Gamma\_1} = u(x)|\_{\\Gamma\_3 } \\text{ and } u(y)|\_{\\Gamma\_2} = u(y)|\_{\\Gamma\_4 } $
%[text] as well as         
%[text]  $n\\nabla\\cdot  u(x)|\_{\\Gamma\_1} = - n\\cdot\\nabla u(x)|\_{\\Gamma\_3 } \\text{ and } n\\cdot \\nabla u(y)|\_{\\Gamma\_2} = -n\\cdot \\nabla  u(y)|\_{\\Gamma\_4 } $
%[text] where $\\Gamma\_k$ and $\\Gamma\_{k+2}$ are opposite boundary segments. 
%[text] In OOPDELight, the combination RectangleR and Bilinear2D offers periodic boundary conditions. 
%[text] The followig demo program shows how to use it. 
%[text] The source term $f$ is chosen here as two Dirac pulses located near a boundary. 
%[text] First we define the domain and chose bilinar finte elements.
Q = RectangleR(0,2,0,3,0.0125);
FEM = Bilinear2D;
%[text] Assemble the linear system. The Dirac pulses are implemented as the values in the grid nodes (we assume, that the pulse is located in a node of the grid).
[K,M,F] = FEM.assema(Q,1,1,0);
H = FEM.periodic(Q);
F(1150) = 1;
%[text] Define and solve the linear system. Note, that the boundary conditions are implemented by a penalty ansatz, so we need a penalty factor (here $s = 10^2$) and the matrix $H$ goes as $H^\\top H$ in the linear system. 
u = (K+M+1e2*(H'*H))\F;
%[text] Plot the solution.
figure(1) %[output:49bd0765]
cla %[output:49bd0765]
Q.plot(u,'EdgeColor','none'); %[output:49bd0765]
view(3) %[output:49bd0765]
pause(10)
%[text] We now continue the solutions around Omega to show the seamless continuation of the periodic solution. We move $\\Omega$ and plot the solution again. 
hold on %[output:49bd0765]
Q.moveMesh([2.0,0]);
Q.plot(u,'EdgeColor','none'); %[output:49bd0765]
Q.moveMesh([0,3.0]);
Q.plot(u,'EdgeColor','none'); %[output:49bd0765]
Q.moveMesh([-2.0,0]);
Q.plot(u,'EdgeColor','none') %[output:49bd0765]
Q.moveMesh([-2.0,0]);
Q.plot(u,'EdgeColor','none'); %[output:49bd0765]
Q.moveMesh([0,-3.0]);
Q.plot(u,'EdgeColor','none'); %[output:49bd0765]
Q.moveMesh([0,-3.0]);
Q.plot(u,'EdgeColor','none') %[output:49bd0765]
Q.moveMesh([2.0,0]);
Q.plot(u,'EdgeColor','none'); %[output:49bd0765]
Q.moveMesh([2.0,0]);
Q.plot(u,'EdgeColor','none'); %[output:49bd0765]
 
view(3)  %[output:49bd0765]

